"64464":{"id":"64464","name":"11.22.63","slug":"11-22-63","original_title":"11.22.63","overview":"Um modesto professor se depara com um portal do tempo que o leva ao dia 9 de setembro de 1958. Ele inicia uma jornada para tentar evitar o assassinato de John F. Kennedy.","first_air_date":"2016-02-15","episode_run_time":81,"vote_average":7.8,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Warner Bros. Television","Bad Robot","Carpenter B."],"genres":["Drama","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/qVBExiGdG8uiPK9BcWD0881u8uh.jpg","poster_path":"https://image.tmdb.org/t/p/original/1fH41ccMKvgDTbbcCxWWH6fznah.jpg","cast":["James Franco","Sarah Gadon","Chris Cooper","Daniel Webber","Lucy Fry"],"trailer":"N/A","seasons":{"1":{"name":"1ª Temporada","poster_path":"https://image.tmdb.org/t/p/original/m1qdHCLatj02ticffwhUyhGphlG.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/m1qdHCLatj02ticffwhUyhGphlG.jpg","air_date":"2016-02-15","episode_count":8,"overview":"James Franco interpreta Jake Epping, um professor de língua inglesa que acaba de assinar o divórcio quando é encarregado pelo seu amigo Al (Chris Cooper) a dar continuidade em sua missão de mudar a história do mundo, usando um portal em uma lanchonete que leva as pessoas ao ano 1960.","vote_average":7.8,"episodes":{"1":{"name":"O Buraco do Coelho","overview":"Jake Epping está cansado e perdido. Sua ex-esposa seguiu em frente, seus estudantes estão sempre distraídos e seu romance, parado. Al Templeton, um de seus amigos mais queridos, mostra a ele o \"buraco de coelho\", um portal secreto que leva ao ano de 1960. Al pede a Jake para voltar no tempo a fim de criar um mundo melhor para isso, ele precisa evitar o assassinato de Kennedy. Jake segue pelo buraco e inicia sua missão, mas descobre que mudar o passado é mais perigos do que jamais havia imaginado.","air_date":"2016-02-15","runtime":81,"still_path":"https://image.tmdb.org/t/p/original/oZvDRnsRYMB56MiOrHGQjk0CsGI.jpg","vote_average":8.2},"2":{"name":"O Matadouro","overview":"Abismado com a enormidade de seu objetivo, Jake decide que uma coisa que pode fazer diferença é salvar a família de seu amigo, Harry Dunning, que foi morta em uma pequena cidade de Kentucky pelo pai fora de controle de Harry, Frank. Será que Jake vai ter coragem de matar este perigoso homem? Quais serão as consequências deste ato?","air_date":"2016-02-22","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/dhodcWoGtiS7RIrIGIppQ6czvJX.jpg","vote_average":7.8},"3":{"name":"Outras Vozes, Outros Quartos","overview":"Jake encontra um aliado inesperado em sua busca por Bill Turcote. Ele descola um trabalho como professor em uma pequena cidade próxima a Dallas e descobre uma ligação romântica com a bibliotecária do local, Sadie Dunhill. Assim, Jake constrói uma vida dupla já que observa Lee Harvey Oswald durante a noite. Ir atrás de Oswald leva Jake ao mundo obscuro de Dallas, onde descobre que Oswald pode não ser a única ameaça que Kennedy terá que enfrentar.","air_date":"2016-02-29","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/azAGcXhxvB1i6K2SOvQT4lqdT6y.jpg","vote_average":7.5},"4":{"name":"Os Olhos do Texas","overview":"A parceria de Jake e Bill começa a desmoronar conforme descobrem mais segredos a respeito do imprevisível Lee Harvey Oswald. A conspiração envolvendo Oswald se aprofunda, ao mesmo tempo em que o romance floresce entre Jake e Sadie.","air_date":"2016-03-07","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/dcEckQC1rjFOdB1mnSjokbxbbtM.jpg","vote_average":7.3},"5":{"name":"A Verdade","overview":"Tudo começa a desmoronar, já que Jake sofre para viver duas vidas: a de professor e a de viajante do tempo. A vida de Sadie é ameaçada, o que leva Jake a ter que tomar uma terrível decisão, ao mesmo tempo em que Bill lida com as coisas sozinho. Lee Harvey Oswald segue por um caminho que o levará a um encontro com seu destino.","air_date":"2016-03-14","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/etSOrHawCEJprvmvKQQm6htWxPa.jpg","vote_average":7.9},"6":{"name":"Feliz Aniversário, Lee Harvey Oswald","overview":"Estamos em outubro de 1962 e a chuva de ameaças em Dallas continua a aumentar. Jake precisa tomar medidas drásticas para estabelecer a dimensão da ameaça a Kennedy. Ao mesmo tempo, ele se depara com uma morte inesperada e uma traição amarga perpetrada por alguém próximo.","air_date":"2016-03-21","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/3f1V3PYHw5LxTx7ZR9ZfQ2Pouli.jpg","vote_average":7.7},"7":{"name":"Garoto Soldado","overview":"O fim está próximo e Jake não parece apto a completar a tarefa. Sadie tenta consertar as coisas, mas ninguém conhece a missão tão bem quanto Jake, Kennedy e o assassino estão em rota de colisão mas será que Jake mudou as coisas o suficiente no passado a fim de alterar os eventos. Os dias se aproximam de 22 de novembro de 1963.","air_date":"2016-03-28","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/nYdT3nsFI9P1bpQ9n8li1oA5Wgm.jpg","vote_average":7.4},"8":{"name":"O Dia em Questão","overview":"O passado usa todas suas armas para evitar que Jake chegue ao Dealey Plaza a tempo de salvar Kennedy. Se falhar, isso pode significar a morte de Jake e aqueles mais próximos a ele. Caso ele seja bem-sucedido, pode criar um mundo no qual perderá tudo que conheceu. Qual é o custo de fazer a coisa certa?","air_date":"2016-04-04","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/2gNhA8f0ZClI0Awq6wqRPNgif1Y.jpg","vote_average":8.4}}}}},
