"67070":{"id":"67070","name":"Fleabag","slug":"fleabag","original_title":"Fleabag","overview":"Uma mulher autêntica que tenta retomar sua vida, enquanto rejeita a ajuda de qualquer um que tente se manter ao seu lado durante a sua crise.","first_air_date":"2016-07-21","episode_run_time":0,"vote_average":8.3,"number_of_seasons":2,"number_of_episodes":12,"created_by":["Phoebe Waller-Bridge"],"production_companies":["Two Brothers Pictures"],"genres":["Comédia","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/zfLW1tXbWCIdCXQ8KUvBzULJm1d.jpg","poster_path":"https://image.tmdb.org/t/p/original/27vEYsRKa3eAniwmoccOoluEXQ1.jpg","cast":["Phoebe Waller-Bridge","Sian Clifford","Andrew Scott"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qI85n9DBgRv6ghhJuzHOCaKXk3v.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qI85n9DBgRv6ghhJuzHOCaKXk3v.jpg","air_date":"2016-07-21","episode_count":6,"overview":"Uma mulher sem traços característicos que se lança à vida moderna em Londres, enquanto lida com a perda de sua melhor amiga, um rompimento e problemas financeiros. café. Tenha uma visão sem censura desse confessional rápido e engraçado de uma mulher tão completamente desapegada que está completamente perdida.","vote_average":7.8,"episodes":{"1":{"name":"Episódio 1","overview":"A irritada, devassa, ultrajante e hilária Fleabag chega fazendo alarde, enquanto ronda pela cidade agarrando-se a qualquer um, ou qualquer coisa que a faça sobreviver.","air_date":"2016-07-21","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/vlFDprUHK2yNBDsbIXsFNP8ludv.jpg","vote_average":7.534},"2":{"name":"Episódio 2","overview":"Assombrada pelas recordações de sua melhor amiga que morreu, abandonada pelo seu frágil namorado, e agora tentando desesperadamente vender aquilo que roubou, Fleabag tenta reacender paixões antigas para se distrair de sua vida conturbada.","air_date":"2016-07-28","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/yQoj0DSvLFsL1rHojlg8NGoFdrS.jpg","vote_average":7.59},"3":{"name":"Episódio 3","overview":"Fleabag ajuda seu cunhado inconveniente a comprar um presente para Claire, que está organizando a sua própria festa surpresa de aniversário. Desesperada por um par, Fleabag volta a procurar seu amigo dentuço.","air_date":"2016-08-04","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/7uo4YNnYcAoCrGkND5YyeFqUGTY.jpg","vote_average":7.514},"4":{"name":"Episódio 4","overview":"Fleabag e sua irmã, Claire, vão a contragosto a um retiro silencioso, por cortesia de seu pai. Seu silêncio forçado é interrompido por um estranho workshop que está acontecendo na casa ao lado.","air_date":"2016-08-11","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/5zqMpp6ITsFaJQgBcDboalu6pKN.jpg","vote_average":7.848},"5":{"name":"Episódio 5","overview":"No aniversário de morte de sua mãe, Fleabag e Claire voltam à casa da família para o almoço anual em memória dela.","air_date":"2016-08-18","runtime":23,"still_path":"https://image.tmdb.org/t/p/original/AmijSCBSw13HcYVrER0gl006cs4.jpg","vote_average":8.161},"6":{"name":"Episódio 6","overview":"Fleabag leva seu ficante para a Sexposição de sua madrinha e acaba tendo alguns desprazeres, incluindo uma declaração de amor, uma obra de arte familiar e uma parede cheia de surpresas.","air_date":"2016-08-25","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/2Aw8Cr7JHtQKOhvr7D7ltuu22sJ.jpg","vote_average":8.267}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/o7ytmKNlOIcCyWXLdtDSRXi5Ruc.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/o7ytmKNlOIcCyWXLdtDSRXi5Ruc.jpg","air_date":"2019-03-04","episode_count":6,"overview":"Fleabag está de volta para uma segunda luta, e dessa vez ela está enfrentando o homem lá de cima. Em uma reviravolta inesperada do destino, nossa diabinha conhece um padre que a faz ver o mundo de uma maneira diferente. Depois de um ano, ainda há feridas a ser descascadas e novas a serem feitas nesse novo capitulo da vida de Fleabag.","vote_average":8.3,"episodes":{"1":{"name":"Episódio 1","overview":"Fleabag celebra o noivado de sua madrinha e seu pai, mas as velhas tensões logo surgem.","air_date":"2019-03-04","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/tVvMWMYZI6snmrENqqW902nTLvf.jpg","vote_average":8.512},"2":{"name":"Episódio 2","overview":"Uma sessão de aconselhamento extrai uma verdade desconfortável de Fleabag e ela se vê em algum lugar inesperado.","air_date":"2019-03-11","runtime":25,"still_path":"https://image.tmdb.org/t/p/original/ucMyzjoAsXCjGWIdz5RUXVa4Suz.jpg","vote_average":8.108},"3":{"name":"Episódio 3","overview":"Fleabag ajuda Claire, e um encontro com uma estranha abre os olhos de Fleabag.","air_date":"2019-03-18","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/61y2hImrdTduoW6oNHqYhPSruYH.jpg","vote_average":8.237},"4":{"name":"Episódio 4","overview":"Após um dia remoendo lembranças dolorosas, Fleabag procura consolo.","air_date":"2019-03-25","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/S3i8zSaqhszv7Rs52QXsnfpebp.jpg","vote_average":8.237},"5":{"name":"Episódio 5","overview":"Claire tem uma crise, e o casamento da madrinha com seu pai está por um fio.","air_date":"2019-04-01","runtime":22,"still_path":"https://image.tmdb.org/t/p/original/7BlMwCK6A6WmZIAM9eRUnEXxfVc.jpg","vote_average":7.972},"6":{"name":"Episódio 6","overview":"Chega o dia do casamento. Será que Fleabag vai ter o final que procura?","air_date":"2019-04-08","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/gRbEddOyeL56X1QNbzGjlyZ1CuD.jpg","vote_average":8.622}}}}},
